}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16"><path d="M0,1V15H16V1ZM15,14H1V2H15Z" class="aw-theme-iconOutline" fill="#464646"/><path d="M7,10H5V9h7V7h2V4H9V7h2V8H5V6H7V3H2V6H4v4H2v3H7Zm3-4V5h3V6ZM3,5V4H6V5Zm3,7H3V11H6Z" class="aw-theme-iconOutline" fill="#464646"/><rect x="10" y="12" width="4" height="1" class="aw-theme-iconOutline" fill="#464646"/></svg>';
        export const SvgComponent = React.memo(SvgComp);
